A sociedade é legalmente regida pelos artigos 986 a 990 do Código Civil brasileiro (Lei nº 10.406, de 10 de janeiro de 2002.).

Estado do Envio da Requisição, pode possuir os seguintes valores:

NÃO PRECISA ENVIAR;
PENDENTE DE ENVIO;
ENVIADO COM SUCESSO;
ENVIADO COM ERRO
